function drawTree(x, y, z, rotation, angle, branches, scale){

  function drawBranch(angle, size, num_branches){
    if (num_branches == 0){
      return
    }
    g_worldMat.scale(size, size, size);  
    pushMatrix(g_worldMat);
      g_worldMat.scale(.26,.26,2);
      gl.uniformMatrix4fv(g_modelMatLoc, false, g_worldMat.elements);

      // draw the prisms as branches
      gl.drawArrays(gl.TRIANGLES, prism_verts - 12, num_prism_verts);


    g_worldMat = popMatrix();
    g_worldMat.translate(0, -.08, -3);

    // draw one branch
    pushMatrix(g_worldMat);
      g_worldMat.rotate(0, 0, 0, 1);
      g_worldMat.translate(0, 0, 1.8*size);
      g_worldMat.rotate(angle, 0, 1,0);
      g_worldMat.translate(0, 0, -1.8*size - .1);
      drawBranch(angle, size, num_branches-1);
    g_worldMat = popMatrix();

    // draw other branch
    pushMatrix(g_worldMat);
      g_worldMat.rotate(120, 0, 0, 1);
      g_worldMat.translate(0, 0, 1.8*size);
      g_worldMat.rotate(angle, 0, 1,0);
      g_worldMat.translate(0, 0, -1.8*size- .1);
      drawBranch(angle, size, num_branches-1);
    g_worldMat = popMatrix();  

      // draw other branch
    pushMatrix(g_worldMat);
      g_worldMat.rotate(120*2, 0, 0, 1);
      g_worldMat.translate(0, 0, 1.8*size);
      g_worldMat.rotate(angle, 0, 1,0);
      g_worldMat.translate(0, 0, -1.8*size- .1);
      drawBranch(angle, size, num_branches-1);
    g_worldMat = popMatrix();  



  }


  //g_worldMat.setIdentity();
  pushMatrix(g_worldMat);

    //g_worldMat.rotate(1,1,0,90)

    g_worldMat.translate(x, y, z);
    g_worldMat.scale(0.2, 0.2, 0.2);
    g_worldMat.scale(scale,scale,scale);

    // rotate so facing up
    g_worldMat.rotate(-90*2, 1, 0, 0);
    g_worldMat.translate(0, 0, -3);   /// TODO figure out how much to translate the trees
    // test prysims


    


    g_worldMat.rotate(rotation,0,0,1);

    pushMatrix(g_worldMat);
      g_worldMat.translate(0.05, 0.05, 1.1);
      g_worldMat.scale(0.2,0.2,0.2);
      // gl.uniformMatrix4fv(g_modelMatLoc, false, g_worldMat.elements);
      // gl.drawArrays(gl.POINTS, octa_verts, cyl_verts - octa_verts);
    g_worldMat = popMatrix();

    drawBranch(40 + g_wind_angle, .7, branches);

    g_worldMat = popMatrix();
}



function nextAngleDragonfly(){
  var now = Date.now();
  var elapsed = now - g_last;
  if (elapsed > 40){
    elapsed = 40;
  }
  g_last = now;

  if (wing_angle > flap_max_angle) {
    wing_angle_rate = -Math.abs(wing_angle_rate);

  }
  if (wing_angle < 0) {
    wing_angle_rate = Math.abs(wing_angle_rate);
    wing_angle = 0;
    
  }
  wing_angle = (elapsed * wing_angle_rate)/1000 + wing_angle;
}



function myMouseMove(event){
  if (g_isDrag == false || !isMouseInCanvas(event) || g_is_paused) {
    //g_objLocX = -0.5;
    //g_objLocY = -0.5;

    return;
  }
  

  var d_x = (event.clientX - g_xMclik);
  var d_y = (event.clientY - g_yMclik);
  var temp_quat = new Quaternion();
  var temp_quat2 = new Quaternion(0,0,0,2)
  var temp_quat3 = new Quaternion(0,0,0,1)

  var look = [g_eye[0]+Math.cos(g_theta) - g_eye[0], g_eye[1]+Math.sin(g_theta)- g_eye[1], g_eye[2]+g_tilt- g_eye[2]]
  var perp = crossProduct(look, g_up)
  normalize(perp)


  temp_quat2.setFromAxisAngle(0, 0, 1, d_x);
  temp_quat2.normalize();
  temp_quat.multiply(temp_quat2, g_quat);
  g_quat.copy(temp_quat);


  temp_quat2.setFromAxisAngle(perp[0], perp[1], perp[2], d_y)
  temp_quat2.normalize();
  temp_quat.multiply(temp_quat2, g_quat);
  g_quat.copy(temp_quat);



  g_xMclik = event.clientX;
  g_yMclik = event.clientY;

}

function isMouseInCanvas(event){
  var rect = event.target.getBoundingClientRect();
  var x = event.clientX - rect.left;
  var y = event.clientY - rect.top;
  return (x >= 0 && x <= g_canvas.width && y >= 0 && y <= g_canvas.width);
}

function myMouseDown(event){
  if (!isMouseInCanvas(event) ){
    g_isDrag = false;
    return
  }
  g_isDrag = true;
  var rect = event.target.getBoundingClientRect();
  g_xMclik = event.clientX
  g_yMclik = event.clientY
}

function myMouseUp(event){
  g_isDrag = false;
}

function myKeyDown(event){
  var look_sense = 0.1
  if (event.code == "KeyP"){
    g_is_paused = !g_is_paused
  }

  /// handle camera movement
  if (event.code == "KeyJ") {// left
    g_theta += look_sense;
  }
  if (event.code == "KeyL"){
    g_theta -= look_sense;
  }
  if (event.code == "KeyI"){
    g_tilt += look_sense / 2
  }
  if (event.code == "KeyK"){
    g_tilt -= look_sense / 2
  }

  if(event.code == "KeyW"){
    moveEyeAlongView(1)
  }
  if(event.code == "KeyS"){
    moveEyeAlongView(-1)
  }
  if(event.code == "KeyD"){
    moveEyeRight(1);
  }
  if(event.code == "KeyA"){
    moveEyeRight(-1);
  }
  if (event.code == "Space"){
    g_eye[2] += 0.05
  }
  if (event.shiftKey){
    g_eye[2] -= 0.05
  }
}


function moveEyeAlongView(direction){
  var vel = 0.1;
  var aim = [g_eye[0]+Math.cos(g_theta), g_eye[1]+Math.sin(g_theta), g_eye[2]+g_tilt]
  var dir = [aim[0]-g_eye[0], aim[1]-g_eye[1], aim[2]-g_eye[2]];
  g_eye[0] = g_eye[0] + dir[0] * direction * vel
  g_eye[1] = g_eye[1] + dir[1] * direction * vel
  g_eye[2] = g_eye[2] + dir[2] * direction * vel

}

function moveEyeRight(direction){
  var right_array = subtract([g_eye[0]+Math.cos(g_theta), g_eye[1]+Math.sin(g_theta), g_eye[2]+g_tilt], g_eye)
  right_array = crossProduct(right_array, g_up);
  right_array = normalize(right_array);
  var vel = 0.1;
  for (var i = 0; i < 3; i++){
    g_eye[i] += right_array[i] * vel * direction
  }
}

// cross product of two 3d arrays
function crossProduct(a, b) {
  return [
      a[1] * b[2] - a[2] * b[1],
      a[2] * b[0] - a[0] * b[2],
      a[0] * b[1] - a[1] * b[0]
  ];
}

function subtract(a, b) {
  return [a[0] - b[0], a[1] - b[1], a[2] - b[2]];
}

// normalize 3d array
function normalize(a) {

  var length = Math.sqrt(a[0] * a[0] + a[1] * a[1] + a[2] * a[2]);
  return [a[0] / length, a[1] / length, a[2] / length];
}



